import React from 'react';
import './Contato.css';
import { FaWhatsapp, FaInstagram, FaFacebook, FaEnvelope } from 'react-icons/fa';

function Contato() {
  return (
    <div className="contato-page">
      <h1 className="contato-title">Entre em contato conosco</h1>
      <div className="contato-socials">
        <a href="https://wa.me/seuNumero" target="_blank" rel="noopener noreferrer" className="contato-link">
          <FaWhatsapp className="contato-icon" /> WhatsApp
        </a>
        <a href="https://instagram.com/seuPerfil" target="_blank" rel="noopener noreferrer" className="contato-link">
          <FaInstagram className="contato-icon" /> Instagram
        </a>
        <a href="https://facebook.com/seuPerfil" target="_blank" rel="noopener noreferrer" className="contato-link">
          <FaFacebook className="contato-icon" /> Facebook
        </a>
        <a href="mailto:seuEmail@exemplo.com" className="contato-link">
          <FaEnvelope className="contato-icon" /> E-mail
        </a>
      </div>
    </div>
  );
}

export default Contato;
